text:
@Victor Hugo falei que desejo todo o mal a vcs? Não
Só falei um fato: vcs roubaram 3 pontos com o juiz, pode tá na final da sula, não me importo, só tô faland desse jogo.
Inclusive vc acabou que confirmar por vc mesmo queo juiz roubou, é banal vcs ein.

@Victor Hugo e o victor hugo diz que é choro, claro que eu vou acreditar no clubismo descarado que n consegue nem ver um jogo inteiro e vê os melhores momentos.
É incrível como vc só entende a parte do roubo(que é vdd), sendo que eu já falei que o ceará perdeu por ele mesmo, mas vc só quer falar do roubo, tentando esconder alguma coisa kkkkk
Calma cara, isso acontece com qualquer time, só aceita que doí menos kkkk, pq eu já aceitei que o ceará perdeu por mal jogo mesmo, sóq vcs ganharam por causa do juiz(inclusive para de olhar pro próprio umbigo, fala como se tivesse roubando pro ceará, é pq vc n viu o jogo aqui no castelão, FOI UM ROUBO, n importa o quanto o seu clubismo n aceita isso kkkk, e olha que eu já vi esse papo de choro, clássico do clubismo que cega a pessoa).
